import React, { Component } from 'react';
import { Row, Col, Tabs } from 'antd';
import './WorkAssignment.style.scss';

const { TabPane } = Tabs;

export default class WorkAssignment extends Component {
  render() {
    return (
      <div className="work-assignment">
        <Row>
          <Col className="work-assignment__left-sidebar" span={4}></Col>
          <Col className="work-assignment__content" span={20}>
            <div className="work-assignment__content__header">
            </div>
            <div className="work-assignment__content__body">
              <Tabs defaultActiveKey="1" onChange={e => console.log(e)}>
                <TabPane tab="Tab 1" key="1">
                  Content of Tab Pane 1
                </TabPane>
                <TabPane tab="Tab 2" key="2">
                  Content of Tab Pane 2
                </TabPane>
                <TabPane tab="Tab 3" key="3">
                  Content of Tab Pane 3
                </TabPane>
              </Tabs>
            </div>
          </Col>
        </Row>
      </div>
    )
  }
}
